import React, { useEffect, useState } from 'react'
import '../App.css';
import { fetchCharacters } from '../Callapi/Helper';
import '../../node_modules/bootstrap/dist/css/bootstrap.min.css'

const Home = () => {
  const [allCharacter, setAllcharacter] = useState('');
  const userCharacters = async () => {
    let myData = await fetchCharacters();
    console.log("myData", myData)
    setAllcharacter(myData.results);
  };
  useEffect(() => {
    userCharacters();
  }, [])
  return (
    <div className="container mt-5 px-2">
      <div className="mb-2 d-flex justify-content-between align-items-center">
        <div className="position-relative"> <span className="position-absolute search"><i className="fa fa-search" /></span> <input className="form-control w-100" placeholder="Search by order#, name..." /> </div>
        <div className="px-2"> <span>Filters <i className="fa fa-angle-down" /></span> <i className="fa fa-ellipsis-h ms-3" /> </div>
      </div>
      <div className="table-responsive">
        <table className="table table-responsive table-borderless">
          <thead>
            <tr className="bg-light">
              <th scope="col" width="5%"><input className="form-check-input" type="checkbox" /></th>
              <th scope="col" width="5%">#</th>
              <th scope="col" width="20%">Date</th>
              <th scope="col" width="10%">Status</th>
              <th scope="col" width="20%">Customer</th>
              <th scope="col" width="20%">Purchased</th>
            </tr>
          </thead>
          {allCharacter ?
            <tbody>

              {allCharacter.map((item) => (
                <tr key={item.id}>
                  <td key={item.id}>{item?.id}</td>
                  <td key={item.id}>{item?.name}</td>
                  <td key={item.id}><i className="fa fa-check-circle-o green" /><span className="ms-1">{item?.status}</span></td>
                  <td key={item.id}><img src="https://i.imgur.com/VKOeFyS.png" width={25} /> {item?.species}</td>
                  <td key={item.id}>{item?.location.name}</td>
                  <td className="text-end" key={item.id}><span className="fw-bolder">$0.99</span> <i className="fa fa-ellipsis-h ms-2" /></td>
                </tr>
              ))}


            </tbody> :
            <tbody>
              <tr>
                <td>No data Found</td>
              </tr>
            </tbody>
          }

        </table>
      </div>
    </div>
  )
}

export default Home
